import React from "react";

const Character = (props) => {
  const characters = props.map((d, i) => {
    return (
      <div key={i} className="result">
        <img src={d.show.image.medium} alt={d.show.name} />
        <p>{d.show.name}</p>
      </div>
    );
  });
  return <div></div>;
};

export default Character;
